import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the cart element using text selector (since class is generic)
    // The cart is a <div class="cart">0 Cart</div>
    await page.waitForSelector('text=/\\d+\\s*Cart/', { timeout: 5000 });

    // Click the cart using text selector (to avoid class-only selectors)
    const cartLocator = await page.locator('text=/\\d+\\s*Cart/').first();
    await cartLocator.click();

    // Wait for the cart modal to appear - look for a modal with heading "Your Cart" or "Cart"
    // The modal has id="cartModal" and class="modal"
    await page.waitForSelector('#cartModal.modal', { timeout: 5000 });

    // Wait for the cart modal to be visible
    await page.waitForSelector('#cartModal.modal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of the open cart modal
    const step2 = path.join(screenshotsDir, 'step_2_cart_modal_open.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract some data to verify the modal is open (e.g., modal heading and number of cart items)
    const modalVisible = await page.$eval('#cartModal.modal', el => window.getComputedStyle(el).display !== 'none');
    let cartTitle = '';
    let cartItemsCount = 0;
    if (modalVisible) {
      // Try to get the modal title
      try {
        cartTitle = await page.$eval('#cartModal .cart-content h2', el => el.textContent.trim());
      } catch {}
      // Try to count cart items
      try {
        cartItemsCount = await page.$$eval('#cartItems .cart-item', els => els.length);
      } catch {}
    }

    return {
      success: true,
      action: "Opened the Shopping Cart modal and verified its display",
      extractedData: {
        cartModalVisible: modalVisible,
        cartTitle,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
